import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route, 
  Link 
} from "react-router-dom";
import About from './pages/About';

function App() {
  return (
    <Router>
      <div className="App">

            <Link to="/about">About</Link>
      </div>
      <Switch>
        <Route path='/about'>
          <About />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
